window.bookSummaryJSON = "<p><b>Okay…where do we pick up? Where we left off, of course.</b></p> <p>Tori’s afraid, but putting forth her toughest exterior to forge ahead with the mess she’s made. And Ashton? Well, he’s confused and angry. It’s his last semester, one that had been planned meticulously by himself and others well before she even knew what a Panther was.</p> <p><i>“You think it’s possible to put the genie back in the f--kin’ bottle now?”</i> Here he was again, saying cryptic things, using phrases that went over her head. “<i>What more can I say? What do you want me to do?\"</i></p> <p>Will Tori can fight her way out of the quandary she’s created at BSU? Will Ashton’s well-planned future be derailed by the new underdog-turned-\"banger\" on campus?</p>"; 
